Test for fix added in #21740","distinct":true,"url":"https://api.github.com/repos/mahak/react/commits/e2453e2007083a67bf93f59c8ef2f39df2aaf636"},{"sha":"cae635054e17a6f107a39d328649137b83f25972","author":{"name":"Andrew Clark","email":"46f1a0bd5592a2f9244ca321b129902a06b53e03@andrewclark.io"},"message":"`act`: Resolve to return value of scope function (#21759)

When migrating some internal tests I found it annoying that I couldn't
return anything from the `act` scope. You would have to declare the
variable on the outside then assign to it. But this doesn't play well
with type systems — when you use the variable, you have to check
the type.

Before:

```js
let renderer;
act(() => {
  renderer = ReactTestRenderer.create(<App />);
})

// Type system can't tell that renderer is never undefined
renderer?.root.findByType(Component);
```

After:

```js
const renderer = await act(() => {
  return ReactTestRenderer.create(<App />);
})
renderer.root.findByType(Component);
```","distinct":true,"url":"https://api.github.com/repos/mahak/react/commits/cae635054e17a6f107a39d328649137b83f25972"}]

[{"sha":"3067d158ee232f51899da48574f0b30da54bf97f","author":{"name":"Deven Desai","email":"bbcec020b514464468c6a99414de2031b1a0cc8b@gmail.com"},"message":"Fix for SWDEV 277899 - hipLaunchKernel called with threads per block value greater than launch bounds attribute.

Prior to the fix for SWDEV 252801, if the application code launches a GPU kernel with a threads per block value which is greater than the `__launch_bounds__` attribute value for that kernel, HIP runtime only issues a warning for this scenario.

After the fix for SWDEV 252801, HIP runtime issues an error message instead (for this scenario), and reports an error status back to the application code.

This change results in the following four TF unit test failures

```
//tensorflow/compiler/tests:depthwise_conv_op_test_gpu
//tensorflow/compiler/tests:depthwise_conv_op_test_gpu_mlir_bridge_test
//tensorflow/python:nn_grad_test_gpu
//tensorflow/python/keras/distribute:saved_model_mixed_api_test_gpu
//tensorflow/python/kernel_tests/signal:fft_ops_test
```

This commit fixes the failure in the first three of the above tests. It was caused by an incorrect calculation of the "threads per block" value. The upper bound for that value (i.e. the `__launch_bounds__` attribute value) was not getting passed to the `GetGpuLaunchConfig`. Passing that value, results in `GetGpuLaunchConfig` returning the correct "threads per block" value and the unit tests start passing","distinct":true,"url":"https://api.github.com/repos/UofT-EcoSystem/tensorflow/commits/3067d158ee232f51899da48574f0b30da54bf97f"},{"sha":"93f3acb54f09ca7ef6d02ec1ba55de4d6ed707ed","author":{"name":"TensorFlower Gardener","email":"746aced590a184ef4169166e753f7c211e32e5fc@tensorflow.org"},"message":"Merge pull request #50430 from ROCmSoftwarePlatform:google_upstream_rocm_fix_launch_bounds_bug

